//icse2017.gatech.edu/"},pdf:"icse-2017-refazer.pdf","acm-dl":"http://dl.acm.org/citation.cfm?id=3097417",arxiv:"https://arxiv.org/abs/1608.09000",dir:"output/projects",base:"refazer.json",ext:".json",sourceBase:"refazer.md",sourceExt:".md"},"output/profile.json":{title:"Profile",dir:"output",base:"profile.json",ext:".json",sourceBase:"profile.md",sourceExt:".md"},"output/news/2017-12-16.json":{date:"2017-12-16",image:"",title:'Spring and Summer Intern for <a href="http://www.jst.go.jp/erato/kawahara/projects/"><strong>ERATO Project',dir:"output/news",base:"2017-12-16.json",ext:".json",sourceBase:"2017-12-16.md",sourceExt:".md"},"output/projects/reactile.json":{id:"reactile",name:"Reactile",description:"Programming Swarm User Interfaces through Direct Physical Manipulation",title:"Reactile: Programming Swarm User Interfaces through Direct Physical Manipulation",authors:"Ryo Suzuki, Jun Kato, Mark D. Gross, Tom Yeh",image:"reactile.jpg",conference:{name:"CHI 2018",url:"https://chi2018.acm.org/"},pdf:"chi-2018-reactile.pdf",video:"https://www.youtube.com/watch?v=Gb7brajKCVE","short-video":"https://www.youtube.com/watch?v=YT7vMJZjohU",slide:"chi-2018-reactile-slide.pdf","acm-dl":"https://dl.acm.org/citation.cfm?id=3173773",github:"https://github.com/ryosuzuki/reactile",abstract:"We explore a new approach to programming swarm user in- terfaces (Swarm UI) by leveraging direct physical manipu- lation. Existing Swarm UI applications are written using a robot programming framework: users work on a computer screen and think in terms of low-level controls. In contrast, our approach allows programmers to work in physical space by directly manipulating objects and think in terms of high- level interface design. Inspired by current UI programming practices, we introduce a four-step workflow—create elements, abstract attributes, specify behaviors, and propagate changes— for Swarm UI programming. We propose a set of direct physi- cal manipulation techniques to support each step in this work- flow. To demonstrate these concepts, we developed Reac- tile, a Swarm UI programming environment that actuates a swarm of small magnets and displays spatial information of program states using a DLP projector. Two user studies—an in-class survey with 148 students and a lab interview with eight participants—confirm that our approach is intuitive and understandable for programming Swarm UIs.",dir:"output/projects",base:"reactile.json",ext:".json",sourceBase:"reactile.md",sourceExt:".md"},"output/projects/tabby.json":{id:"tabby",name:"Tabby",description:"Explorable Design for 3D Printing Textures",title:"Tabby: Explorable Design for 3D Printing Textures",authors:"Ryo Suzuki, Koji Yatani, Mark D. Gross, Tom Yeh",image:"tabby.png",conference:{name:"Pacific Graphics 2018",url:"http://sweb.cityu.edu.hk/pg2018/"},pdf:"pg-2018-tabby.pdf",video:"https://www.youtube.com/watch?v=rRgw8lH74CA",dir:"output/projects",base:"tabby.json",ext:".json",sourceBase:"tabby.md",sourceExt:".md"},"output/projects/trace-diff.json":{id:"trace-diff",name:"TraceDiff",description:"Debugging Unexpected Code Behavior Using Trace Divergences",title:"TraceDiff: Debugging Unexpected Code Behavior Using Trace Divergences",authors:"Ryo Suzuki, Gustavo Soares, Andrew Head, Elena Glassman, Ruan Reis, Melina Mongiovi, Loris D’Antoni, Bjoern Hartmann",image:"tracediff.png",conference:{name:"VL/HCC 2017",url:"https://sites.google.com/site/vlhcc"},pdf:"vlhcc-2017-tracediff.pdf",slide:"vlhcc-2017-tracediff-slide.pdf",github:"https://github.com/ryosuzuki/trace-diff",demo:"https://ryosuzuki.github.io/trace-diff/",ieee:"http://ieeexplore.ieee.org/document/8103457/",arxiv:"https://arxiv.org/abs/1708.03786a",dir:"output/projects",base:"trace-diff.json",ext:".json",sourceBase:"trace-diff.md",sourceExt:".md"},"output/awards.json":{title:"JST ACT-I, 2018",dir:"output",base:"awards.json",ext:".json",sourceBase:"awards.md",sourceExt:".md"},"output/updates.json":{title:"Recent Updates",dir:"output",base:"update